import { Fragment } from "react"

const Header = () => {
    return(
        <Fragment>
            <h2>React Meals</h2>
            <h2>Your Cart</h2>
            <img src="https://www.gettyimages.com/detail/video/heres-to-good-food-and-good-friends-stock-footage/1036757084?adppopup=true"></img>
        </Fragment>
    )
}
export default Header;
